    uint maxTransaction;
    uint minTransaction;
    uint256[] countries ; 
    string public message;


    constructor (uint256 _totalFunds){
        TotalFunds = _totalFunds;
    }


    function sendMoney(uint _amount, address _receiver) public m_validAddress(_receiver) {
        receiver = _receiver;
        amount = _amount;

        if(TotalFunds > 0 && TotalFunds > amount){
            TotalFunds -= amount;

        }
        else {

        }
    }

    modifier m_validAddress(address _addr) {
        receiver = _addr;
        require(_addr != address(0), " This address doesn't exists");

        _;
    }
